import React, {useEffect} from 'react'

const Aktuelles = () => {
    const POST_URL = 'https://www.facebook.com/facebook/posts/516935257292145';
  
    useEffect(() => {
      window.FB.XFBML.parse();
    }, []);
  
    return (
      <div className="fb-post"  data-href={POST_URL} 
      data-width="600" 
      data-height="800" 
      data-tabs="timeline, events" 
      data-show-text="false" 
      data-colorscheme="dark"></div>
    );
  }

export default Aktuelles
